import data from './goods.json'

function GoodsRender() {

    return (
        <div className="goods">
            <div className="goods_title"><h1>Популярные товары</h1></div>
            <div className="goods_wrapper">
                <div className="card">
                    <img src="#" alt={data.name} />
                </div>
            </div>
        </div>
    )
}

export default GoodsRender;
